import React from "react";

function TodoItem({ task }) {
  const onChange = () => {
    console.log("active");
  };
  return (
    <li>
      <input
        type="checkbox"
        name=""
        id=""
        className="list__checkbox"
        onChange={onChange}
      />
      <p>{task}</p>
    </li>
  );
}

export default TodoItem;
